import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const CreditCard = () => {
    return(
    <View style={styles.container}>
        <View style={styles.body}>
            <Text style={styles.text}>XYZ_Bank</Text>
            <Text style={styles.text}>0900 7860 1000 0000</Text>
            <Text style={styles.text}>Valid till {'\n'} 09/26</Text>
        </View>
    </View>
    );
}

const styles = StyleSheet.create({
    container:{
        height:'100%',
        width: '100%',
        backgroundColor: '#21567B',
        borderRadius: 18,
        padding: 10,
    },
    body: {
        height: '100%',
        justifyContent: "space-around",
    },
    text: {
        color:'#C2DFF4',
        padding: 10,
    },
})

export default CreditCard;
